import './App.css';
import React from "react";
import {
  BrowserRouter as Router,
  Route,
  Switch,
  NavLink
} from "react-router-dom";

//pages
import Account from './components/Account';
import List from './components/List';

function App() {
  return (
    <div className="App">
      <Router>
      <div>
        <nav>
          <ul>
            <li>
              <NavLink to="/">Account</NavLink>
            </li>
            <li>
              <NavLink to="/users">users</NavLink>
            </li>
          </ul>
        </nav>

        <Switch>
        <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch> 
      </div>
    </Router>
    </div>
  );
}

function Home() {
  return <h2>Home</h2>;
}

function Users() {
  return <h2>users</h2>;
}

export default App;
